import styles from './Informacoes.module.css';
import imagem from '../../img/Informacoes.png';
import arquivoPDF from '../../img/Curriculo.pdf';

function Informacoes() {
  return (
    <section className={styles.informacoes_container}>
      <div className={styles.image_column}>
        <img src={imagem} alt="Imagem" />
      </div>
      <div className={styles.info_column}>
        <h2>Hello, I am Mack Smith</h2>
        <ul>
          <li><strong>Nome:</strong>       Seu Nome</li>
          <li><strong>Idade:</strong>      Sua Idade</li>
          <li><strong>Endereço:</strong> Seu Endereço</li>
          <li><strong>Telefone:</strong> Seu Telefone</li>
          <li><strong>Email:</strong> Seu Email</li>
        </ul>
        <button className={styles.download_button}>
          <a href={arquivoPDF} download>
            Download CV
          </a>
        </button>
      </div>
    </section>
  );
}

export default Informacoes;
